import './assets/css/App.css';
import Login from './components/Login';
import { Switch, BrowserRouter, Route } from 'react-router-dom';
import React from 'react';


function App() {

  return (
<React.Fragment>
    <BrowserRouter>  
    <Switch>

    <Route path="/" exact render = { props=> (<Login {...props}/>)}>

    </Route>

    </Switch>


    </BrowserRouter>




</React.Fragment>
  );
}

export default App;
